import React, {useState, useEffect} from 'react'

function App(){

  const [data, setData] = useState([{}])

  useEffect(() =>{
    fetch("/home").then(
      res => res.json()
    ).then(
      data => {
        setData(data)
        console.log(data)
      }
    )
  }, [])

  return (
    <div>
      {data.preguntas && data.preguntas.length > 0 ? (
        data.preguntas.map((member, i) => (
          <p key={i}>{member}</p>
        ))
      ) : (
        <p>No hay preguntas disponibles.</p>
      )}
    </div>
  );
}

export default App;
